--TẠO CÁC BẢNG CODE---
--1. Loại hình TSBĐ---
create table COL_TYPE
(
ID int identity(1,1),
COL_TYPE_CODE nvarchar(10),
COL_TYPE_NAME nvarchar(500) 
)


--2. Khu vực
create table CODE_AREA
(
ID				int identity(1,1),
AREA_CODE	nvarchar(10),
AREA_NAME	nvarchar(50)
)



--3. Loại Giấy tờ
create table CODE_ID_TYPE
(
ID				int identity(1,1),
ID_TYPE_CODE	nvarchar(10),
ID_TYPE_NAME	nvarchar(50)
)



--4. Loại hình khách hàng
create table CODE_CUST_TYPE
(
ID					int identity(1,1),
CUST_TYPE_CODE		nvarchar(10),
CUST_TYPE_NAME		nvarchar(50)
)



--5. Loại hình chuyển khoản
create table CODE_TRANSFER_TYPE
(
ID						int identity(1,1),
TRANSFER_TYPE_CODE		nvarchar(10),
TRANSFER_TYPE_NAME		nvarchar(50)
)


--6. Loại hình doanh nghiệp
create table CODE_ORG_TYPE
(
ID				int identity(1,1),
ORG_TYPE_CODE	nvarchar(5),
ORG_TYPE_NAME	nvarchar(500),
CUST_TYPE_CODE	nvarchar(5)
)


--7. Ngành nghề kinh tế.

create table CODE_FIN_TYPE
(
ID				int identity(1,1),
FIN_TYPE_CODE	nvarchar(5),
FIN_TYPE_NAME	nvarchar(500)
)



--8. CODE_CITY --
create table CODE_CITY
(
ID				int identity(1,1),
SHORT_NAME		nvarchar(5),
CITY_CODE		int,
CITY_NAME		nvarchar(50)
)

--9. Chi nhánh TCTD ----

create table CODE_BRANCH
(
ID					int identity(1,1),
BRANCH_CODE			nvarchar(20),
BRANCH_NAME			nvarchar(500),
BRANCH_ADDRESS		nvarchar(max),
CITY_CODE			int,
AREA_CODE			nvarchar(10)
)


--10. Khách hàng

create table CUSTOMER
(
ID				int identity(1,1),
BRANCH_CODE		nvarchar(10),
CUSTID			nvarchar(12),
CUSTNAME		nvarchar(500),
DATE_OF_BIRTH	DATE,
ID_NUMBER		nvarchar(20),
CUST_TYPE_CODE	nvarchar(10),
ID_TYPE_CODE	nvarchar(5),
ID_DATE			date,
ID_CITY			int,
CUST_ADD		nvarchar(max),
ESTABLISH		date,
ESTABLISH_CITY	int,
CASA_ACCOUNT	nvarchar(20),
OWNER_NAME		nvarchar(500),
OWNER_ID		nvarchar(50),
ORG_TYPE_CODE	nvarchar(5),
FIN_TYPE_CODE	nvarchar(5)
);


--11. Tài khoản tiết kiệm
CREATE TABLE SAVING_ACCOUNT
(
	ID				INT		IDENTITY(1,1),
	CUSTID			NVARCHAR(12),	--> mã khách hàng
	SAVING_ACC_ID	NVARCHAR(20),	--> mã tài khoản
	SAVE_DATE		DATE,			--> ngày gửi
	SAVE_END_DATE	DATE,			--> ngày kết thúc
	INTEREST		NUMERIC(10,2),	--> lãi suất
	SAV_AMOUNT		NUMERIC(18,2),	--> số tiền khách gửi
	INTEREST_VAL	NUMERIC(18,2),	--> số tiền lãi
	TOTAL_VAL		NUMERIC(18,2),	--> tổng số tiền khách nhận (= gốc + lãi)
	AUTO_EXTEND		INT,			--> tự gia hạn: 0-không tự gia hạn/1- tự gia hạn
	WITHDRAW_DAY	DATE,			--> ngày rút
	SAV_STATUS		INT				---> trạng thái: 0- chưa tất toán/1 - đã tất toán
)


--12 Hợp đồng tín dụng﻿
CREATE TABLE CREDIT_CONTRACT
(
ID						INT		IDENTITY(1,1),
CUSTID					NVARCHAR(20),
DEBID					NVARCHAR(20),
MA_ID					NVARCHAR(20),
CRCONTRACT_ID			NVARCHAR(MAX),
CR_CONTRACT_DATE		DATE,
CR_AMOUNT				NUMERIC(18,2),	
CR_CONTRACT_END_DATE	DATE,	
CR_INTEREST				NUMERIC(18,2)
);


--13 Hợp đồng thế chấp

CREATE TABLE MORTGAGE_AGREEMENT
(
	ID			INT	IDENTITY(1,1),
	MA_ID		NVARCHAR(20),
	MA_NAME		NVARCHAR(MAX),
	MA_DATE		DATE,
	NOTE		NVARCHAR(MAX)
)

--INSERT INTO MORTGAGE_AGREEMENT VALUES('',N'','',N'');--


--Tài sản bảo đảm

CREATE TABLE COLLATERALS
(
ID				INT		IDENTITY(1,1),
COL_ID			NVARCHAR(20),
COL_TYPE_CODE	NVARCHAR(20), 
COL_AMOUNT 		NUMERIC(18,2),
COL_ADD			NVARCHAR(MAX),
CITY_CODE		INT,	
MA_ID			NVARCHAR(20)
)




----------------------------------------------------------------------------------------------
--Kế hoạch trả nợ

CREATE TABLE CREDIT_PLAN(
	ID			int NOT NULL,
	PLAN_ID			nvarchar(20) NULL,
	DEBID			nvarchar(20) NULL,
	PRE_AMOUNT		numeric(18, 0) NULL,
	PERIOD_ID		int NULL,
	START_DATE		date NULL,
	END_DATE		date NULL,
	PERIOD_LEN		int NULL,
	INTEREST		numeric(5, 2) NULL,
	PRINCIPAL_AMOUNT	numeric(18, 0) NULL,
	INTEREST_AMOUNT	        numeric(18, 0) NULL,
	TOTAL_AMOUNT 		numeric(18, 0) NULL
);


----------------------------------------------------------------------------------------------
-- Khách hàng trả nợ
CREATE TABLE CUSTOMER_REPAYMENT(
	ID			int,
	DEBID			nvarchar(20) NULL,
	PERIOD_ID		int NULL,
	PAYMENT_DATE		date NULL,
	PRINCIPAL_AMOUNT	numeric(18, 0) NULL,
	INTEREST_AMOUNT	        numeric(18, 0) NULL
);


-- Transfer history

CREATE TABLE TRANSFER_HISTORY (
    ID INT PRIMARY KEY,
    CASA_ACCOUNT NVARCHAR(15),
    TRANS_TIME DATETIME,
    PRE_AMOUNT NUMERIC(18, 0),
    INCREASE NUMERIC(18, 0),
    DECREASE NUMERIC(18, 0),
    AFTER_AMOUNT NUMERIC(18, 0),
    CUR_CODE NVARCHAR(5),
    NOTE NVARCHAR(MAX),
    SENT_ACC NVARCHAR(50),
    DESTINATION_ACC NVARCHAR(50),
    TRANSFER_TYPE_CODE NVARCHAR(5)
);

